INSERT INTO `site_settings` (`id`, `tittle`, `website`, `page_tittle`, `about`, `home`, `sitelogo`, `favicon`, `maps`, `maps2`, `header`, `meta_tittle`, `meta_keywords`, `meta_description`) VALUES
(1, 'Ettafly', '', 'Vizag Tax and Service', '<p>St. John&rsquo;s School is a co-educational institution committed to provide quality education at an affordable cost to all sections of society. As said by G.K.Chesterton &ldquo;Education is simply the soul of a society as it passes from one generation to another&rdquo; Therefore we believe in providing education with a combination of academics, sports, extra and co- curricular activities with an aim to mould every generation into wholesome and dynamic individuals. &ldquo;Every child matters.&rdquo; at St.John&rsquo;s. Founded in 2004, in a huge sprawling serene campus at Kasimkota. St .Johns has earned an enviable reputation as one of the top ranked schools in rural area of Visakhapatnam .We are a proud community of over 900 students and 60 staff</p>\r\n', '<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the<br />\r\nindustry&#39;s standard dummy text ever since the 1500s</p>\r\n', '20190725165446199_ettafly_loga.png', '20200107184257502_whatsapp_image_2019_12_18_at_17_44_52.jpeg', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d487295.02532044525!2d78.12785129924684!3d17.41215307568293!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3bcb99daeaebd2c7%3A0xae93b78392bafbc2!2sHyderabad%2C+Telangana!5e0!3m2!1sen!2sin!4v1558532454541!5m2!1sen!2sin', '', '', 'Ettafly', 'Ettafly', 'Ettafly');
